import{_ as e}from"./app.63e06a35.js";import{l as r,m as a,K as i}from"./@vue.46e0ff50.js";import"./ts-debounce.471e9b22.js";import"./vue-router.66b7519d.js";import"./medium-zoom.0cdb07e4.js";import"./@vueuse.f471c5d7.js";const t={},o=i('<p>RFC(Request for Comment) \uD504\uB85C\uC138\uC2A4\uB294 \uC0C8\uB85C\uC6B4 \uAE30\uB2A5\uC774 \uD504\uB85C\uC81D\uD2B8\uC5D0 \uD1B5\uD569\uB418\uB294 \uC77C\uAD00\uB41C \uC81C\uC5B4 \uACBD\uB85C\uB97C \uC81C\uACF5\uD558\uB294 \uAC83\uC744 \uBAA9\uD45C\uB85C \uD569\uB2C8\uB2E4. \uC774\uB294 \uC0C8\uB85C\uC6B4 \uAE30\uB2A5\uC774 \uC798 \uC124\uACC4\uB418\uACE0, \uC798 \uAD6C\uD604\uB418\uBA70, \uCDA9\uBD84\uD788 \uD14C\uC2A4\uD2B8\uB418\uBA70, \uD504\uB85C\uC81D\uD2B8 \uC804\uBC18\uC801\uC778 \uBC29\uD5A5\uACFC \uBC94\uC704\uC640 \uCDA9\uB3CC\uD558\uC9C0 \uC54A\uB3C4\uB85D \uB3D5\uB294 \uB370 \uB3C4\uC6C0\uC774 \uB429\uB2C8\uB2E4.</p><h2 id="\u1106\u1169\u11A8\u1111\u116D" tabindex="-1"><a class="header-anchor" href="#\u1106\u1169\u11A8\u1111\u116D" aria-hidden="true">#</a> \uBAA9\uD45C</h2><p>\uBC84\uADF8 \uC218\uC815 \uBC0F \uBB38\uC11C \uAC1C\uC120\uACFC \uAC19\uC740 \uB9CE\uC740 \uBCC0\uACBD \uC0AC\uD56D\uC740 \uBCF4\uD1B5\uC758 GitHub \uD480 \uB9AC\uD018\uC2A4\uD2B8 \uC6CC\uD06C\uD50C\uB85C\uB97C \uD1B5\uD574 \uAD6C\uD604\uB418\uACE0 \uAC80\uD1A0\uB420 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uADF8\uB7EC\uB098 \uC77C\uBD80 \uBCC0\uACBD \uC0AC\uD56D\uC740 \u201C\uC911\uC694\uD558\uB2E4\u201D\uACE0 \uAC04\uC8FC\uB418\uBA70, \uC774\uB7EC\uD55C \uBCC0\uACBD \uC0AC\uD56D\uC740 \uB514\uC790\uC778 \uD504\uB85C\uC138\uC2A4\uB97C \uAC70\uCE58\uACE0 \uCEE4\uBBA4\uB2C8\uD2F0 \uC758\uACAC\uC744 \uC218\uB834\uD558\uACE0 Storybook \uCF54\uC5B4 \uD300 \uAC04\uC5D0 \uD569\uC758\uC5D0 \uB3C4\uB2EC\uD560 \uAC83\uC744 \uC694\uCCAD\uD569\uB2C8\uB2E4.</p><p>RFC(Request for Comment) \uD504\uB85C\uC138\uC2A4\uC758 \uBAA9\uC801\uC740 \uB2E4\uC74C\uACFC \uAC19\uC2B5\uB2C8\uB2E4:</p><ul><li>\uC0C8\uB85C\uC6B4 \uAE30\uB2A5 \uC544\uC774\uB514\uC5B4\uB97C \uC81C\uC548\uD560 \uC218 \uC788\uB294 \uD22C\uBA85\uD55C \uC2DC\uC2A4\uD15C\uC744 \uC81C\uACF5\uD569\uB2C8\uB2E4.</li><li>\uD504\uB85C\uC81D\uD2B8\uC5D0 \uC0C8\uB85C\uC6B4 \uAE30\uB2A5\uC744 \uB3C4\uC785\uD558\uAE30 \uC704\uD55C \uC2E0\uB8B0\uD560 \uC218 \uC788\uACE0 \uC798 \uC870\uC808\uB41C \uD504\uB85C\uC138\uC2A4\uB97C \uC218\uB9BD\uD569\uB2C8\uB2E4.</li><li>\uCEE4\uBBA4\uB2C8\uD2F0\uAC00 \uC0C8\uB85C\uC6B4 \uAE30\uB2A5 \uAC1C\uBC1C\uC5D0 \uCC38\uC5EC\uD560 \uC218 \uC788\uB294 \uBC29\uBC95\uC744 \uC81C\uACF5\uD569\uB2C8\uB2E4.</li></ul><h3 id="\u1100\u1175\u1102\u1173\u11BC-\u110B\u116D\u110E\u1165\u11BC-\u1103\u1162-rfc" tabindex="-1"><a class="header-anchor" href="#\u1100\u1175\u1102\u1173\u11BC-\u110B\u116D\u110E\u1165\u11BC-\u1103\u1162-rfc" aria-hidden="true">#</a> \u201C\uAE30\uB2A5 \uC694\uCCAD\u201D \uB300 \u201CRFC\u201D</h3><p>\uAE30\uB2A5 \uC694\uCCAD\uC740 Storybook \uC0AC\uC6A9\uC790\uAC00 \uD504\uB85C\uC81D\uD2B8\uC5D0 \uC0C8\uB85C\uC6B4 \uAE30\uB2A5\uC774\uB098 \uAC1C\uC120\uC744 \uC81C\uC548\uD558\uB294 \uAC04\uB2E8\uD558\uACE0 \uBE44\uAD50\uC801 \uBE44\uACF5\uC2DD\uC801\uC778 \uBC29\uC2DD\uC785\uB2C8\uB2E4. \uAE30\uB2A5 \uC694\uCCAD\uC740 \uAC00\uCE58 \uC788\uB294 \uD1B5\uCC30\uACFC \uC544\uC774\uB514\uC5B4\uB97C \uC81C\uACF5\uD560 \uC218 \uC788\uC9C0\uB9CC, \uC77C\uBC18\uC801\uC73C\uB85C \uD575\uC2EC \uD300 \uAC04\uC758 \uD569\uC758\uAC00 \uD544\uC694\uD558\uAC70\uB098 \uC2EC\uB3C4 \uC788\uB294 \uB514\uC790\uC778 \uACFC\uC815\uC744 \uC694\uAD6C\uD558\uC9C0\uB294 \uC54A\uC2B5\uB2C8\uB2E4. \uAE30\uB2A5 \uC694\uCCAD\uC740 \uC77C\uBC18\uC801\uC73C\uB85C \uD1A0\uB860\uC774 \uAC00\uB2A5\uD558\uBA70, \uC778\uAE30, \uC2E4\uD589 \uAC00\uB2A5\uC131 \uBC0F \uD504\uB85C\uC81D\uD2B8\uC758 \uBAA9\uD45C\uC640\uC758 \uC77C\uCE58 \uC5EC\uBD80 \uB4F1\uACFC \uAC19\uC740 \uC694\uC18C\uC5D0 \uAE30\uBC18\uD558\uC5EC \uAD6C\uD604\uB420 \uC218\uB3C4 \uC788\uACE0 \uADF8\uB807\uC9C0 \uC54A\uC744 \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4.</p><p>\uBC18\uBA74\uC5D0 RFC\uB294 \uD504\uB85C\uC81D\uD2B8\uC5D0 \uC911\uC694\uD55C \uBCC0\uACBD \uC0AC\uD56D\uC774\uB098 \uCD94\uAC00\uC0AC\uD56D\uC744 \uC81C\uC548\uD558\uAE30 \uC704\uD55C \uB354 \uD615\uC2DD\uD654\uB418\uACE0 \uAD6C\uC870\uD654\uB41C \uD504\uB85C\uC138\uC2A4\uC785\uB2C8\uB2E4. \uC81C\uC548\uB41C \uAE30\uB2A5\uC774\uB098 \uC218\uC815 \uC0AC\uD56D\uC774 \uC801\uC808\uD55C \uACE0\uB824, \uB514\uC790\uC778 \uBC0F \uD53C\uB4DC\uBC31\uC744 \uBC1B\uB3C4\uB85D \uD655\uC2E4\uD55C \uB2E8\uACC4\uB97C \uB530\uB985\uB2C8\uB2E4. RFC\uB294 \uC77C\uBC18\uC801\uC73C\uB85C \uD504\uB85C\uC81D\uD2B8\uC5D0 \uC911\uC694\uD55C \uC601\uD5A5\uC744 \uBBF8\uCE58\uB294 \uBCC0\uACBD \uC0AC\uD56D\uC5D0 \uB300\uD574 \uC0AC\uC6A9\uB418\uBA70, \uC0C8\uB85C\uC6B4 API \uAE30\uB2A5 \uB3C4\uC785, \uAE30\uC874 \uAE30\uB2A5 \uC81C\uAC70 \uB610\uB294 \uC0C8\uB85C\uC6B4 \uC0AC\uC6A9 \uADDC\uCE59 \uC218\uB9BD\uACFC \uAC19\uC740 \uACBD\uC6B0\uC5D0 \uC801\uD569\uD569\uB2C8\uB2E4. RFC \uD504\uB85C\uC138\uC2A4\uB294 \uD1A0\uB860\uC744 \uCD09\uC9C4\uD558\uACE0 \uB354 \uB113\uC740 \uAD00\uAC1D\uC73C\uB85C\uBD80\uD130 \uD53C\uB4DC\uBC31\uC744 \uC218\uC9D1\uD558\uBA70, \uD575\uC2EC \uD300 \uAC04\uC758 \uD569\uC758\uB97C \uB3C4\uCD9C\uD558\uC5EC \uC81C\uC548\uB41C \uBCC0\uACBD \uC0AC\uD56D\uC744 \uD504\uB85C\uC81D\uD2B8\uC5D0 \uD1B5\uD569\uD558\uAE30 \uC804\uC5D0 \uC218\uB9BD\uD569\uB2C8\uB2E4. \uC218\uB77D\uB41C RFC\uB294 \uC77C\uBC18\uC801\uC778 \uAE30\uB2A5 \uC694\uCCAD\uBCF4\uB2E4 \uAD6C\uD604\uB420 \uAC00\uB2A5\uC131\uC774 \uB192\uC2B5\uB2C8\uB2E4.</p><h2 id="rfc-\u1105\u1161\u110B\u1175\u1111\u1173\u1109\u1161\u110B\u1175\u110F\u1173\u11AF" tabindex="-1"><a class="header-anchor" href="#rfc-\u1105\u1161\u110B\u1175\u1111\u1173\u1109\u1161\u110B\u1175\u110F\u1173\u11AF" aria-hidden="true">#</a> RFC \uB77C\uC774\uD504\uC0AC\uC774\uD074</h2><h3 id="_1-\u1109\u1161\u11BC\u1110\u1162-\u110C\u1166\u110B\u1161\u11AB\u1103\u116C\u11B7" tabindex="-1"><a class="header-anchor" href="#_1-\u1109\u1161\u11BC\u1110\u1162-\u110C\u1166\u110B\u1161\u11AB\u1103\u116C\u11B7" aria-hidden="true">#</a> 1. \uC0C1\uD0DC: \uC81C\uC548\uB428</h3><p>&quot;RFC&quot; \uCE74\uD14C\uACE0\uB9AC\uB85C \uC0C8 GitHub \uD1A0\uB860\uC744 \uC5FD\uB2C8\uB2E4. \uC9C0\uC2DC\uC5D0 \uB530\uB77C \uC591\uC2DD\uC5D0 \uC791\uC131\uD569\uB2C8\uB2E4.</p><p>\uC138\uBD80 \uC0AC\uD56D\uC774 \uC911\uC694\uD569\uB2C8\uB2E4: \uC124\uB4DD\uB825 \uC788\uB294 \uB3D9\uAE30\uB97C \uC81C\uC2DC\uD558\uC9C0 \uC54A\uAC70\uB098 \uB514\uC790\uC778 \uC601\uD5A5\uC744 \uC81C\uB300\uB85C \uC774\uD574\uD558\uC9C0 \uBABB\uD558\uAC70\uB098 \uB2E8\uC810\uC774\uB098 \uB300\uC548\uC5D0 \uB300\uD574 \uC194\uC9C1\uD558\uC9C0 \uC54A\uC740 RFC\uB294 \uC77C\uBC18\uC801\uC73C\uB85C \uBD80\uC815\uC801\uC73C\uB85C \uBC1B\uC544\uB4E4\uC5EC\uC9D1\uB2C8\uB2E4.</p><h3 id="_2-\u1109\u1161\u11BC\u1110\u1162-\u1100\u1165\u11B7\u1110\u1169-\u110C\u116E\u11BC" tabindex="-1"><a class="header-anchor" href="#_2-\u1109\u1161\u11BC\u1110\u1162-\u1100\u1165\u11B7\u1110\u1169-\u110C\u116E\u11BC" aria-hidden="true">#</a> 2. \uC0C1\uD0DC: \uAC80\uD1A0 \uC911</h3><p>RFC\uB4E4\uC740 \uBCF4\uD1B5 \uC774 \uB2E8\uACC4\uC5D0 \uC624\uB798 \uBA38\uBB34\uB974\uBA70 \uCEE4\uBBA4\uB2C8\uD2F0\uC640 \uCF54\uC5B4 \uD300 \uBA64\uBC84\uB4E4\uC774 \uCC2C\uBC18 \uC758\uACA2\uC744 \uB0B4\uB193\uC744 \uC2DC\uAC04\uC744 \uAC00\uC9D1\uB2C8\uB2E4. \uC774 \uAE30\uAC04 \uB3D9\uC548 RFC\uC758 \uC800\uC790\uB294 \uC81C\uC548\uC11C\uB97C \uC218\uC815\uD558\uACE0 \uD53C\uB4DC\uBC31\uC744 \uD1B5\uD569\uD558\uBA70 \uD569\uC758\uB97C \uC774\uB8E8\uAE30 \uC704\uD574 \uC900\uBE44\uD574\uC57C \uD569\uB2C8\uB2E4. \uB300\uBD80\uBD84\uC758 \uC9C0\uC9C0\uB97C \uBC1B\uB294 RFC\uB294 \uC758\uACAC\uC774 \uC5C6\uB294 \uAC83\uBCF4\uB2E4 \uB354 \uB098\uC740 \uC9C4\uC804\uC744 \uC774\uB8E8\uAE30 \uC27D\uC2B5\uB2C8\uB2E4.</p><p>\uB9E4\uC8FC \uC6D4\uC694\uC77C \uBBF8\uAD6D \uB3D9\uBD80\uC2DC\uAC04 11\uC2DC\uC5D0 Storybook \uCF54\uC5B4 \uD300\uC740 \uD68C\uC758 \uC77C\uC815\uC758 \uC77C\uBD80\uB85C \uC5F4\uB9B0 RFC\uB97C \uAC80\uD1A0\uD558\uAE30 \uC704\uD55C \uC8FC\uAC04 \uD68C\uC758\uB97C \uC9C4\uD589\uD569\uB2C8\uB2E4. \uC774 \uD68C\uC758\uB294 Storybook Discord\uC758 Watercooler \uCC44\uB110\uC5D0\uC11C \uC9C4\uD589\uB429\uB2C8\uB2E4. \uC6B0\uB9AC\uB294 RFC\uC758 \uC800\uC790 \uBC0F \uAD00\uC2EC \uC788\uB294 \uCEE4\uBBA4\uB2C8\uD2F0 \uAD6C\uC131\uC6D0\uB4E4\uC744 \uCD08\uB300\uD558\uC5EC RFC\uC5D0 \uB300\uD574 \uBCF4\uB2E4 \uC790\uC138\uD55C \uD1A0\uB860\uC5D0 \uCC38\uC5EC\uD558\uACE0 \uB17C\uC758\uD560 \uAC83\uC744 \uAD8C\uC7A5\uD569\uB2C8\uB2E4. \uCF54\uC5B4 \uD300 \uBA64\uBC84\uAC00 \uD544\uC694\uD558\uB2E4\uACE0 \uD310\uB2E8\uD558\uBA74, \uADF8\uB4E4\uC740 RFC\uC758 &quot;\uCC54\uD53C\uC5B8&quot;\uC73C\uB85C \uC9C0\uC815\uB420 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uCC54\uD53C\uC5B8\uC740 RFC \uC800\uC790\uC640 \uD611\uB825\uD558\uC5EC RFC \uD504\uB85C\uC138\uC2A4 \uC804\uBC18\uC5D0 \uAC78\uCCD0 \uB3C4\uC640\uC904 \uAC83\uC785\uB2C8\uB2E4.</p><h3 id="_3-\u1109\u1161\u11BC\u1110\u1162-\u1109\u1173\u11BC\u110B\u1175\u11AB-\u1100\u1165\u110C\u1165\u11AF" tabindex="-1"><a class="header-anchor" href="#_3-\u1109\u1161\u11BC\u1110\u1162-\u1109\u1173\u11BC\u110B\u1175\u11AB-\u1100\u1165\u110C\u1165\u11AF" aria-hidden="true">#</a> 3. \uC0C1\uD0DC: \uC2B9\uC778/\uAC70\uC808</h3><p>\uACB0\uAD6D \uD300\uC5D0\uC11C\uB294 RFC\uAC00 Storybook\uC5D0 \uD3EC\uD568\uB420 \uD6C4\uBCF4\uC778\uC9C0 \uC5EC\uBD80\uB97C \uACB0\uC815\uD560 \uAC83\uC785\uB2C8\uB2E4. \uBC18\uBA74\uC5D0 \uACF5\uAC1C \uD1A0\uB860\uC774 \uB9C8\uBB34\uB9AC\uB418\uACE0 \uBC18\uB300 \uC758\uACAC\uC774 \uC81C\uC2DC\uB41C \uD6C4 \uD300\uC5D0 \uC758\uD574 RFC\uAC00 \uAC70\uBD80\uB420 \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4.</p><h2 id="\u1109\u1173\u11BC\u110B\u1175\u11AB\u1103\u116C\u11AB-rfc-\u1100\u116E\u1112\u1167\u11AB" tabindex="-1"><a class="header-anchor" href="#\u1109\u1173\u11BC\u110B\u1175\u11AB\u1103\u116C\u11AB-rfc-\u1100\u116E\u1112\u1167\u11AB" aria-hidden="true">#</a> \uC2B9\uC778\uB41C RFC \uAD6C\uD604</h2><p>RFC\uC758 \uC791\uC131\uC790\uB294 \uC774\uB97C \uAD6C\uD604\uD560 \uC758\uBB34\uAC00 \uC5C6\uC2B5\uB2C8\uB2E4. \uBB3C\uB860, RFC \uC791\uC131\uC790(\uB2E4\uB978 \uAC1C\uBC1C\uC790\uC640 \uB9C8\uCC2C\uAC00\uC9C0\uB85C)\uB294 RFC\uAC00 \uC2B9\uC778\uB41C \uD6C4 \uB9AC\uBDF0\uB97C \uC704\uD574 \uAD6C\uD604\uC744 \uAC8C\uC2DC\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uADF8\uB7EC\uB098 &quot;\uC2B9\uC778&quot; \uC0C1\uD0DC\uB294 \uC6B0\uC120 \uC21C\uC704\uB098 \uD604\uC7AC \uC791\uC5C5 \uC911\uC778\uC9C0 \uC5EC\uBD80\uB97C \uB098\uD0C0\uB0B4\uC9C0 \uC54A\uC74C\uC744 \uC8FC\uC758\uD558\uC138\uC694.</p><p>\uB9CC\uC57D &quot;\uC9C4\uD589 \uC911&quot; RFC\uB97C \uAD6C\uD604\uD558\uACE0 \uC2F6\uC9C0\uB9CC \uB2E4\uB978 \uB204\uAD70\uAC00\uAC00 \uC774\uBBF8 \uADF8 \uC791\uC5C5\uC744 \uD558\uACE0 \uC788\uB294\uC9C0 \uC54C \uC218 \uC5C6\uB2E4\uBA74, \uC5F0\uAD00\uB41C \uC774\uC288\uC5D0 \uC758\uACAC\uC744 \uB0A8\uACA8 \uC9C8\uBB38\uD558\uC2ED\uC2DC\uC624.</p><p>\uC774 RFC \uD504\uB85C\uC138\uC2A4\uB294 Rust\uC640 Gatsby\uC758 RFC \uD504\uB85C\uC138\uC2A4\uC5D0\uC11C \uB9CE\uC740 \uC601\uAC10\uC744 \uBC1B\uC558\uC5B4\uC694.</p><p>Storybook\uC5D0 \uAE30\uC5EC\uD558\uB294 \uBC29\uBC95\uC5D0 \uB300\uD574 \uB354 \uC54C\uC544\uBCF4\uC138\uC694</p><ul><li>\uAE30\uB2A5 \uC694\uCCAD\uC744 \uC791\uC131\uD558\uB294 RFC \uD504\uB85C\uC138\uC2A4</li><li>\uC0C8\uB85C\uC6B4 \uAE30\uB2A5\uACFC \uBC84\uADF8 \uC218\uC815\uC744 \uC704\uD55C \uCF54\uB4DC</li><li>\uC0C8\uB85C\uC6B4 \uD504\uB808\uC784\uC6CC\uD06C\uB85C \uC2DC\uC791\uD558\uB294 \uBC29\uBC95</li><li>\uBB38\uC11C \uAC1C\uC120, \uC624\uD0C0 \uBC0F \uBA85\uD655\uD654\uB97C \uC704\uD55C \uBB38\uC11C</li><li>\uC0C8\uB85C\uC6B4 \uC2A4\uB2C8\uD3AB\uACFC \uC608\uC2DC\uC5D0 \uB300\uD55C \uC608\uC81C</li></ul>',23),h=[o];function d(l,c){return r(),a("div",null,h)}var F=e(t,[["render",d],["__file","index.html.vue"]]);export{F as default};
